import React from "react";
import AgendaMedica from "../../components/AgendaMedica";
import AgendaOnline from "../../components/AgendaOnline";
import ListaPacientes from "../../components/ListaPacientes";
import GerenPacientes from "../../components/GerenPacientes";
import ProntuarioElect from "../../components/ProntuarioElect";
import GerenClinic from "../../components/GerenClinic";
import Graficos from "../../components/Graficos";
import Financeiro from "../../components/Financeiro";
import '../../css/main.css'

const Dashboard: React.FC = () => {
  return (
    <div className="dashboard-container">
      <div className="sidebar">
        <div className="logo" /> {/* Adicione a classe "logo" aqui */}
        {/* Adicione links para outras páginas ou funcionalidades, se necessário */}
      </div>

      <div className="main-content">
        <h1>Dashboard</h1>
        <div>
          <AgendaMedica />
        </div>
        <div>
          <AgendaOnline />
        </div>
        <div>
          <ListaPacientes />
        </div>
        <div>
          <GerenPacientes />
        </div>
        <div>
          <ProntuarioElect />
        </div>
        <div>
          <GerenClinic />
        </div>
        <div>
          <Graficos />
        </div>
        <div>
          <Financeiro />
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
